window.bookSummaryJSON = "<p><b>The 16th book in the <i>New York Times</i> best-selling Elemental Assassin urban fantasy series that <i>RT Book Reviews</i> calls \"an extraordinary series...[containing] one of the most intriguing heroines in the genre\".</b> </p> <p>If you don't know Gin \"the Spider\" Blanco, you don't know dangerous female heroines. </p> <p>Irony 101 - the Spider herself snared in someone else's web... </p> <p>Another week, another few clues trickling in about the Circle, the mysterious group that supposedly runs the city's underworld. Gathering intel on my hidden enemies is a painstaking process, but a more immediate mystery has popped up on my radar: a missing girl. </p> <p>My search for the girl begins on the mean streets of Ashland, but with all the killers and crooks in this city, I'm not holding out much hope that she's still alive. </p> <p>A series of clues leads me down an increasingly dark, dangerous path, and I realize that the missing girl is really just the first thread in this web of evil. As an assassin, I'm used to facing down the worst of the worst, but nothing prepares me for this new, terrifying enemy - one who strikes from the shadows and is determined to make me the next victim. </p>"; 
